import React from "react";
import styles from './Header.module.css'
import mealsImage from './assets/meals.jpg'


function Header (){
return (
    <React.Fragment>
    <Header className={styles.header}>
        <h1>React Meals</h1>
    </Header>
    <div>
        <img src={mealsImage}/>
    </div>
    </React.Fragment>
)

}
export default Header
